import { combineReducers } from "redux";
import authReducer from "./authReducer";
import errorReducer from "./errorReducer";
import jobOrders from "./jobOrdersReducer";
import invoices from "./invoiceReducer";
import jobTemplates from "./jobTemplatesReducer";
import productionReducer from "./productionReducer"
import userInvoices from "./invoiceUserReducer"

import doMyShoot from "./doMyShootReducer";


export default combineReducers({
  auth: authReducer,
  errors: errorReducer,
  jobOrders: jobOrders,
  invoices: invoices,
  jobTemplates:jobTemplates,
  productions:productionReducer,
  userInvoices: userInvoices,
  doMyShoot:doMyShoot,
});
